import React, { Component } from "react";
import { Route } from "react-router-dom";
import VerifyAT1 from "../components/AT - Form/VerifyAT1";
import VerifyAT2 from "../components/AT - Form/VerifyAT2";
import VerifyAT3 from "../components/AT - Form/VerifyAT3";
import VerifyAT4 from "../components/AT - Form/VerifyAT4";
import VerifyAT5 from "../components/AT - Form/VerifyAT5";
import VerifyAT7 from "../components/AT - Form/VerifyAT7";
import VerifyAT8 from "../components/AT - Form/VerifyAT8";
import QICRoute from "../auth/qicRoute";
export class VerifyAT extends Component {
  render() {
    return (
      <div>
        <QICRoute
          path={process.env.PUBLIC_URL + "/VerifyAT1/:id"}
          exact={true}
          component={VerifyAT1}
        />
        <QICRoute
          path={process.env.PUBLIC_URL + "/VerifyAT2/:id"}
          exact={true}
          component={VerifyAT2}
        />
          <QICRoute
          path={process.env.PUBLIC_URL + "/VerifyAT3/:id"}
          exact={true}
          component={VerifyAT3}
        />
          <QICRoute
          path={process.env.PUBLIC_URL + "/VerifyAT4/:id"}
          exact={true}
          component={VerifyAT4}
        />
         <QICRoute
          path={process.env.PUBLIC_URL + "/VerifyAT5/:id"}
          exact={true}
          component={VerifyAT5}
        />
         <QICRoute
          path={process.env.PUBLIC_URL + "/VerifyAT7/:id"}
          exact={true}
          component={VerifyAT7}
        />
         <QICRoute
          path={process.env.PUBLIC_URL + "/VerifyAT8/:id"}
          exact={true}
          component={VerifyAT8}
        />
      </div>
    );
  }
}

export default VerifyAT;
